	(915, '76815', 'represents a focused quick look exam limited to the assessment of one or more of the elements listed in code 76815. Use only once per exam and not per element.', 'Ultrasound, pregnant uterus, real time with image documentation, limited (eg, fetal heart beat, placental location, fetal position and/or qualitative amniotic fluid volume), one or more fetuses', 'US ob limited fetus(s)', 'US', 0.65, true, 3, 38, '2025-08-19 21:05:35.210661+00'),
