	(916, '76816', 'Describes an examination designed to reassess fetal size and interval growth or reevaluate one or more anatomic abnormalities of a fetus previously demonstrated on ultrasound, and should be coded once for each fetus requiring reevaluation using modifier 59 for each fetus after the first.', 'Ultrasound, pregnant uterus, real time with image documentation, follow-up (eg, re-evaluation of fetal size by measuring standard growth parameters and amniotic fluid volume, re-evaluation of organ system(s) suspected or confirmed to have a problem on a previous scan), transabdominal approach, per fetus', 'US ob fu per fetus', 'US', 0.85, true, 3, 39, '2025-08-19 21:05:35.210661+00'),
	(917, '76817', 'Describes a transvaginal obstetric ultrasound performed separately or in addition to one of the transabdominal examinations described above. For transvaginal examinations performed for non-obstetrical purposes, use code 76830. If transvaginal examination is done in addition to transabdominal obstetrical ultrasound exam, use 76817 in addition to appropriate transabdominal exam code.', 'Ultrasound, pregnant uterus, real time with image documentation, transvaginal', 'US ob transvag', 'US', 0.75, true, 3, 40, '2025-08-19 21:05:35.210661+00'),
	(918, '76818', 'Fetal biophysical profile assessments for the second and any additional fetuses, should be reported separately by code 76818 or 76819 with the modifier 59 appended. For amniotic fluid index without non-stress test, use 76815.', 'Fetal biophysical profile; with non-stress testing', 'US bpp wi nst', 'US', 1.05, true, 3, 41, '2025-08-19 21:05:35.210661+00'),
