	(928, '76856', 'Includes the complete evaluation of the female pelvic anatomy. Elements of this examination include a description and measurements of the uterus and adnexal structures, measurement of the endometrium, measurement of the bladder (when applicable), and a description of any pelvic pathology (eg, ovarian cysts, uterine leiomyomata, free pelvic fluid). Also applicable to a complete evaluation of the male pelvis. Elements of the examination include evaluation and measurement (when applicable) of the urinary bladder, evaluation of the prostate and seminal vesicles to the extent that they are visualized transabdominally, and any pelvic pathology (eg, bladder tumor, enlarged prostate, free pelvic fluid, pelvic abscess).', 'Ultrasound, pelvic (nonobstetric), real time with image documentation; complete', 'US pel comp', 'US', 0.69, true, 3, 11, '2025-08-19 21:05:35.210661+00'),
	(929, '76857', 'Represents a focused examination limited to the assessment of one or more elements listed in code 76856 and/or the reevaluation of one or more pelvic abnormalities previously demonstrated on ultrasound. Code 76857, rather than 76770, should be utilized if the urinary bladder alone (ie, not including the kidneys) is imaged, whereas code 51798 should be utilized if a bladder volume or post-void residual measurement is obtained without imaging the bladder.', 'Ultrasound, pelvic (nonobstetric), real time with image documentation; limited or follow-up (eg, for follicles)', 'US pel lim', 'US', 0.50, true, 3, 12, '2025-08-19 21:05:35.210661+00'),
