	(932, '76881', 'Represents a complete evaluation of a specific joint in an extremity. Code 76881 requires ultrasound examination of all of the following joint elements: joint space (eg, effusion), peri-articular soft-tissue structures that surround the joint (ie, muscles, tendons, other soft-tissue structures), and any identifiable abnormality. In some circumstances, additional evaluations such as dynamic imaging or stress maneuvers may be performed as part of the complete evaluation. Code 76881 also requires permanently recorded images and a written report containing a description of each of the required elements or reason that an element(s) could not be visualized (eg, absent secondary to surgery or trauma). When fewer than all of the required elements for a complete exam (76881) are performed, report the limited code (76882).', 'Ultrasound, complete joint (ie, joint space and peri-articular soft tissue structures), real time with image documentation', 'US ext joint comp', 'US', 0.90, true, 3, 16, '2025-08-19 21:05:35.210661+00'),
	(933, '76882', 'Represents a limited evaluation of a joint or focal evaluation of a structure(s) in an extremity other than a joint (eg, soft-tissue mass, fluid collection, or nerve[s]). Limited evaluation of a joint includes assessment of a specific anatomic structure(s) (eg, joint space only [effusion] or tendon, muscle, and/or other soft-tissue structure[s] that surround the joint) that does not assess all of the required elements included in 76881. Code 76882 also requires permanently recorded images and a written report containing a description of each of the elements evaluated.', 'Ultrasound, limited, joint or focal evaluation of other nonvascular extremity structure(s) (eg, joint space, peri-articular tendon[s], muscle[s], nerve[s], other soft-tissue structure[s], or soft-tissue mass[es]), real-time with image documentation', 'US ext lim', 'US', 0.69, true, 3, 17, '2025-08-19 21:05:35.210661+00'),
